import React, { useState } from "react";
import { useNavigate } from "react-router-dom";

function Register() {
  const navigate = useNavigate();
  const [formData, setFormData] = useState({
    primerNombre: "",
    segundoNombre: "",
    primerApellido: "",
    segundoApellido: "",
    identificacion: "",
    email: "",
    fechaNacimiento: "",
    ubicacion: {
      lugar: "",
      ciudad: "",
      departamento: "",
    },
    usuario: {
      login: "",
      password: "",
    },
  });

  const [showModal, setShowModal] = useState(false);
  const [modalMessage, setModalMessage] = useState("");
  const [modalType, setModalType] = useState("");

  const handleChange = (e) => {
    const { name, value } = e.target;
    if (name.includes(".")) {
      const [objectName, field] = name.split(".");
      setFormData((prevData) => ({
        ...prevData,
        [objectName]: {
          ...prevData[objectName],
          [field]: value,
        },
      }));
    } else {
      setFormData((prevData) => ({ ...prevData, [name]: value }));
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    const currentDate = new Date();
    const selectedDate = new Date(formData.fechaNacimiento);
    const year = selectedDate.getFullYear();

    if (selectedDate > currentDate) {
      alert("La fecha de nacimiento no puede ser futura.");
      return;
    }

    if (year < 1900 || year > 2100) {
      alert("El año de nacimiento debe estar entre 1900 y 2100.");
      return;
    }

    const dataToSend = {
      ...formData,
      identificacion: parseInt(formData.identificacion),
      usuario: {
        ...formData.usuario,
        id: {
          login: formData.usuario.login,
          persona: null, // This will be set by the backend
        },
      },
    };

    try {
      const response = await fetch("http://localhost:9001/Laboratorio1/persona", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(dataToSend),
      });

      let responseData;
      const contentType = response.headers.get("content-type");

      if (contentType && contentType.includes("application/json")) {
        responseData = await response.json();
      }

      if (response.ok) {
        setModalMessage("Registro exitoso.");
        setModalType("success");
        setShowModal(true);
        // Redirigir a otra página si es necesario
        // navigate("/somewhere");
      } else {
        setModalMessage(responseData.message || "Error al registrar.");
        setModalType("error");
        setShowModal(true);
      }
    } catch (error) {
      console.error("Error al enviar el formulario:", error);
      setModalMessage("Error de conexión.");
      setModalType("error");
      setShowModal(true);
    }
  };

  return (
    <div className="container mt-5">
      <h2>Registro de Usuario</h2>
      <form onSubmit={handleSubmit}>
        <div className="form-group">
          <label>Primer Nombre</label>
          <input
            type="text"
            name="primerNombre"
            value={formData.primerNombre}
            onChange={handleChange}
            className="form-control"
            required
          />
        </div>
        <div className="form-group">
          <label>Segundo Nombre</label>
          <input
            type="text"
            name="segundoNombre"
            value={formData.segundoNombre}
            onChange={handleChange}
            className="form-control"
          />
        </div>
        <div className="form-group">
          <label>Primer Apellido</label>
          <input
            type="text"
            name="primerApellido"
            value={formData.primerApellido}
            onChange={handleChange}
            className="form-control"
            required
          />
        </div>
        <div className="form-group">
          <label>Segundo Apellido</label>
          <input
            type="text"
            name="segundoApellido"
            value={formData.segundoApellido}
            onChange={handleChange}
            className="form-control"
          />
        </div>
        <div className="form-group">
          <label>Identificación</label>
          <input
            type="number"
            name="identificacion"
            value={formData.identificacion}
            onChange={handleChange}
            className="form-control"
            required
          />
        </div>
        <div className="form-group">
          <label>Email</label>
          <input
            type="email"
            name="email"
            value={formData.email}
            onChange={handleChange}
            className="form-control"
            required
          />
        </div>
        <div className="form-group">
          <label>Fecha de Nacimiento</label>
          <input
            type="date"
            name="fechaNacimiento"
            value={formData.fechaNacimiento}
            onChange={handleChange}
            className="form-control"
            required
          />
        </div>
        <div className="form-group">
          <label>Lugar de Ubicación</label>
          <input
            type="text"
            name="ubicacion.lugar"
            value={formData.ubicacion.lugar}
            onChange={handleChange}
            className="form-control"
            required
          />
        </div>
        <div className="form-group">
          <label>Ciudad</label>
          <input
            type="text"
            name="ubicacion.ciudad"
            value={formData.ubicacion.ciudad}
            onChange={handleChange}
            className="form-control"
            required
          />
        </div>
        <div className="form-group">
          <label>Departamento</label>
          <input
            type="text"
            name="ubicacion.departamento"
            value={formData.ubicacion.departamento}
            onChange={handleChange}
            className="form-control"
            required
          />
        </div>
        <div className="form-group">
          <label>Nombre de Usuario</label>
          <input
            type="text"
            name="usuario.login"
            value={formData.usuario.login}
            onChange={handleChange}
            className="form-control"
            required
          />
        </div>
        <div className="form-group">
          <label>Contraseña</label>
          <input
            type="password"
            name="usuario.password"
            value={formData.usuario.password}
            onChange={handleChange}
            className="form-control"
            required
          />
        </div>
        <button type="submit" className="btn btn-primary mt-3">
          Registrar
        </button>
      </form>

      {showModal && (
        <div className="modal" tabIndex="-1" role="dialog" style={{ display: "block" }}>
          <div className="modal-dialog" role="document">
            <div className={`modal-content ${modalType === "success" ? "bg-success" : "bg-danger"}`}>
              <div className="modal-header">
                <h5 className="modal-title text-white">
                  {modalType === "success" ? "Éxito" : "Error"}
                </h5>
                <button
                  type="button"
                  className="close"
                  onClick={() => setShowModal(false)}
                >
                  <span>&times;</span>
                </button>
              </div>
              <div className="modal-body">
                <p className="text-white">{modalMessage}</p>
              </div>
              <div className="modal-footer">
                <button type="button" className="btn btn-secondary" onClick={() => setShowModal(false)}>
                  Cerrar
                </button>
              </div>
            </div>
          </div>
        </div>
      )}
    </div>
  );
}

export default Register;
